css:
.git-diff-details-outer {
  background-color: #363430;
  width: 100%;
}
.git-diff-details-main-panel {
  position: relative;
}
.git-diff-details-button-panel {
  text-align: right;
  padding: 2px;
  width: 100%;
}
.line.git-diff-details-new {
  background-color: rgba(162, 232, 120, 0.7) !important;
  color: black !important;
}
.line.git-diff-details-new span {
  color: black !important;
}
.line.git-diff-details-new .invisible-character {
  opacity: 0;
}
.line.git-diff-details-old {
  background-color: rgba(232, 120, 120, 0.7) !important;
  color: black !important;
}
.line.git-diff-details-old span {
  color: black !important;
}
